export interface Product {
  id: string;
  name: string;
  description?: string;
  price: number;
  quantity: number;
  soldQuantity: number;
  viewedQuantity: number;
  images: string[]; // Nếu có nhiều hình ảnh, có thể là mảng
  image: string | null; // Nếu không có ảnh, có thể là null
  category?: {
    _id: string;
    name: string;
  };
}

export interface ProductList {
  products: Product[];
  pagination: {
    page: number;
    size: number;
    page_size: number;
  };
}
